window.bookSummaryJSON = "<p><b>Betrayed. Murdered. Reborn. One last chance, to make it right. </b>&nbsp;</p> <p>Theo's adventure ended with his mentor's hands around his neck. The betrayal cost him his friends, allies and everything he had built...but not his life. Though broken and powerless, Theo has one last chance to enter the Nine Worlds, wielding the knowledge and expertise of his first life. This time, he needs more than just power, he needs to unravel the deception that killed him once...and is coming for him again.</p> <p>Reborn in the world of Tatian, the odds are stacked against Theo this time. Demons are crawling from the darkness, inter-dimensional travelers are working against him, and a shadowy conspiracy lies in wait to destroy him. Theo has a plan to gather allies and regain his power, but weakened from his rebirth, he'll have to survive long enough to enact it.</p> <p>Sarah Lin is the best-selling author of Street Cultivation, the critically acclaimed <i>The Brightest Shadow</i>, and several other completed works. <i>Soulhome </i>is the first book in her newest series.</p>"; 
